import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import './ReservationList.css';
import "@popperjs/core";
import './Reservation.css';
import Table from './table';

const waitinglist = {
    'date':'07.04. 13:00',
    'shop':'봉봉살롱',
    'address':'부산광역시',
    'telephone':'010-0000-0000'
}

class WaitingList extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
          showDetails: false
        };
      }
    handleDetailsClick = () => {
        this.setState((prevState) => ({
          showDetails: !prevState.showDetails
        }));
      };
    render(){
        return(
            <div>
                <div>예약완료</div>
                <div className="rowline"></div>  
                <div className="col_">
                    <p className="tile">예약일자</p>
                    <p className="tile">반려동물이름</p>
                    <p className="tile">보호자 이름</p>
                    <p className="tile">보호자 연락처</p>
                    <p className="tile">예약상세</p>
                </div> 
                <ReservationList
                date ={waitinglist.date}
                shop = {waitinglist.shop}
                address = {waitinglist.address}
                telephone = {waitinglist.telephone}
                />
                <ReservationList
                date ={waitinglist.date}
                shop = {waitinglist.shop}
                address = {waitinglist.address}
                telephone = {waitinglist.telephone}
                />
                <ReservationList
                date ={waitinglist.date}
                shop = {waitinglist.shop}
                address = {waitinglist.address}
                telephone = {waitinglist.telephone}
                />
                <ReservationList
                date ={waitinglist.date}
                shop = {waitinglist.shop}
                address = {waitinglist.address}
                telephone = {waitinglist.telephone}
                />
                <ReservationList
                date ={waitinglist.date}
                shop = {waitinglist.shop}
                address = {waitinglist.address}
                telephone = {waitinglist.telephone}
                />

            </div>           
        )
    
    }
        
}
export default WaitingList;
